Plot = import("https://esm.sh/@observablehq/plot") 

Plot.plot({
  y: {grid: true},
  color: {legend: true},
  marks: [
    Plot.rectY(transpose(data), Plot.binX({y: "count"}, 
    {x: "rows", fill: "dichotomous"})),
    Plot.ruleY([0])
  ]
})
















Plot.plot({
  x: {type: "log"},
  y: {type: "log"},
  grid: true,
  color: {legend: true},
  marks: [
    Plot.dot(transpose(data), {
      x: "n_items", 
      y: "n_participants", 
      stroke: "dichotomous"
    }),
    Plot.tip(transpose(data), Plot.pointer({
      x: "n_items",
      y: "n_participants",
      stroke: "dichotomous",
      title: "dataset_name"
    })),
    Plot.linearRegressionY(transpose(data), {
      x: "n_items", 
      y: "n_participants", 
      stroke: "dichotomous"
    })
  ] 
})
